<li><a href="#about">About</a></li>
<li><a href="#investments">Investments</a></li>
<li><a href="#contact">Contact</a></li>
</ul>
</nav>
</header>

const Home = () => {
  return (
    <div className="home-container">
      <h1>Welcome to Real Wealth</h1>
